    MarcadorWaterPoloComponent.prototype.guardarSucesoParametro = function (event) {
        var _this = this;
        this.mensaje = [];
        if (event.DeportePeriodoId) {
            this.conjuntoService.guardarSucesoParametro(event).subscribe(function (res) {
                var resp = res.json();
                if (resp) {
                    _this.botonSucesoBloqueo = false;
                    _this.mensaje.push({
                        severity: 'success',
                        summary: 'Exito',
                        detail: 'Se agrego correctamente el registro'
                    });
                    if (_this.sucesoPersona.Orden === 3) {
                        _this.actualizarVisor();
                    }
                    if (_this.sucesoPersona.Orden === 2) {
                        _this.actualizarVisorFaltas();
                    }
                    _this.cargarBotonesEquipo(event.CompetidorId, event.PlanillaId, event.posicion_grid, _this.DeportePeriodoIdSuceso);
                    _this.seleccionarParametro(event.CompetidorId, event.PlanillaId, event.posicion_grid);
                    _this.getPuntosPlanilla();
                }
                else {
                    _this.mensaje.push({
                        severity: 'danger',
                        summary: 'Error',
                        detail: 'Error al guardar el registro'
                    });
                }
            });
        }
        else {
            this.mensaje.push({
                severity: 'danger',
                summary: 'Error',
                detail: 'Error al guardar el registro'
            });
        }
    };
