    /*cronometro */
    MarcadorWaterPoloComponent.prototype.pause = function (estadopause) {
        if (estadopause) {
            this.iniciarPausa();
            this.pauseSocket = true;
            this.iniciado = false;
        }
        this.accion = 3;
        if (this.iniciar) {
            this.pausa = true;
            this.iniciar = false;
        }
        this.parar = false;
        this.mostrar_pausa = false;
        this.mostrar_play = true;
        this.band_pos = false;
        var noguardar = 0;
        this.detenerPosesion(noguardar);
        this.iniciaEquipo(0);
        this.enlinea = false;
        this.actualizarAccion();
    };
    MarcadorWaterPoloComponent.prototype.play = function (estadoplay) {
        if (this.control_Periodo()) {
            if (estadoplay) {
                this.iniciarPlay();
                this.playSocket = true;
            }
            this.accion = 1;
            this.iniciar = true;
            this.pausa = false;
            this.parar = false;
            this.mostrar_pausa = true;
            this.mostrar_play = false;
            // this.calcularPosesion(this.iniciaId, this.posIniciaId, false, 0);
            this.capturarTiempo(0, 0);
            this.guardarHoraInicio();
            this.enlinea = true;
        }
        this.actualizarAccion();
    };
    MarcadorWaterPoloComponent.prototype.stop = function () {
        this.accion = 2;
        this.parar = true;
        this.iniciar = false;
        this.pausa = false;
        this.actualizarAccion();
    };
